import Link from 'next/link';



function MovieInfoLink({ id, src, koreanTitle }) {
    return (
      <div>
        <Link href="/movieInfo/[id]" as={`/movieInfo/${id}`}>
          <a>
            <img src={src} style={{ height: '310px', borderRadius: '10px' }} />
            <div>{koreanTitle}</div>
          </a>
        </Link>
      </div>
    )
};

export default MovieInfoLink;
